  PRIMARY KEY (`id`),
  KEY `FK_zone_location_id` (`location_id`),
  CONSTRAINT `FK_zone_location_id` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

